snippet.textDisplay:
@Eg Mxes parte de America del norte y un país con gran riqueza, ni que fuéramos pobres en la punta de la nada como para que no vieran beneficios al abastecernos.
Ahora bien, eso que dijiste es el principal error con mx. Vamos avanzando porque tarde o temprano seremos del primer mundo, pero podríamos ir muchísimo más rápido si tuviéramos gobernantes capaces y ciudadanos conscientes. 
En pocas palabras: Necesitamos más patriotismo y menos conformismo.

